import React, { Component } from "react";
import "./App.css";
import Homepage from "./components/Homepage";
import { Routes, Route } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div>
        <Routes> 
          <Route path="./" element={<Homepage />} />

        </Routes>  

      </div>
    );
  }
}

export default App;
